%spark.r
fail.suites <- function(frame) {
    suites <- levels(frame$suite)
    suites[sapply(suites, function(suite) {
        t.b <- frame[which(frame$suite == suite & frame$run == "before" & frame$pass == T),c("freq")]
        t.a <- frame[which(frame$suite == suite & frame$run == "after" & frame$pass == T),c("freq")]
        f.b <- frame[which(frame$suite == suite & frame$run == "before" & frame$pass == F),c("freq")]
        f.a <- frame[which(frame$suite == suite & frame$run == "after" & frame$pass == F),c("freq")]
        (t.b != t.a) | (f.b != f.a)
    })]
}

group.frame <- function(frame, group) {
    frame[which(frame$group == group),]
}
